import './App.css';
import clear from './weather-icons/clear.svg';
import mostlycloudy from './weather-icons/mostlycloudy.svg';
function App() {
  return (
    <div className="App">
      <div className="appHeader">
        <input type="text" placeholder="london"></input>
        <button>FIND WEATHER</button>
      </div>
      <div className="body">      
        <img src={mostlycloudy} />
        <h3>overcast clouds</h3>
        <p><span className='strong'>Tempreture</span> 10C to 11C</p>
        <p><span className='strong'>humidity</span> 78% <span className='strong'>pressure</span> 100.48</p>
      </div>
      <div className="footer">
      <div className="tempHour"><p>03:00</p><p><img src={mostlycloudy}></img></p><p>19°C</p></div>
      <div className="tempHour"><p>03:00</p><p><img src={mostlycloudy}></img></p><p>19°C</p></div>
      <div className="tempHour"><p>03:00</p><p><img src={clear}></img></p><p></p></div>
      <div className="tempHour"><p>03:00</p><p><img src={clear}></img></p><p></p></div>
      <div className="tempHour"><p>03:00</p><p><img src={clear}></img></p><p></p></div>
      <div className="tempHour"><p>03:00</p><p><img src={clear}></img></p><p></p></div>
      <div className="tempHour"><p>03:00</p><p><img src={clear}></img></p><p></p></div>
      <div className="tempHour"><p>03:00</p><p><img src={mostlycloudy}></img></p><p></p></div>
      </div>
    </div>
  );
}

export default App;
